/*Table structure for table `hold` */

DROP TABLE IF EXISTS `hold`;

CREATE TABLE `hold` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `total` double DEFAULT NULL,
  `total_tax` double DEFAULT NULL,
  `no_items` int(11) DEFAULT NULL,
  `hold_time` int(11) DEFAULT NULL,
  `sales_rep` int(11) DEFAULT NULL,
  `customer` int(11) DEFAULT NULL,
  `bid` int(11) DEFAULT NULL,
  `cashier` int(11) DEFAULT NULL,
  `descr` varchar(40) DEFAULT NULL,
  `till` int(11) DEFAULT NULL,
  `up_branch` int(11) DEFAULT NULL,
  `up_id` int(11) DEFAULT NULL,
  `up` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `hold` */

/*Table structure for table `items` */

DROP TABLE IF EXISTS `items`;

CREATE TABLE `items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `look_up` varchar(55) DEFAULT NULL,
  `item_desc` text,
  `item_type` varchar(20) DEFAULT NULL,
  `buy_price` double DEFAULT NULL,
  `sell_price` double DEFAULT NULL,
  `floor_price` double DEFAULT NULL,
  `ceil_price` double DEFAULT NULL,
  `qty` int(11) DEFAULT NULL,
  `tax` varchar(20) DEFAULT NULL,
  `country` varchar(20) DEFAULT NULL,
  `pack` varchar(20) DEFAULT NULL,
  `ext_desc` text,
  `discount` double DEFAULT NULL,
  `reg_time` int(11) DEFAULT NULL,
  `profit` varchar(10) DEFAULT NULL,
  `mfg_date` varchar(10) DEFAULT NULL,
  `exp_date` varchar(10) DEFAULT NULL,
  `code_no` varchar(20) DEFAULT NULL,
  `batch_no` varchar(20) DEFAULT NULL,
  `reorder_level` int(11) DEFAULT NULL,
  `sub_catg` int(11) DEFAULT NULL,
  `catg` int(40) DEFAULT NULL,
  `sn_no` varchar(30) DEFAULT NULL,
  `status` varbinary(20) DEFAULT '1',
  `bar_code` varchar(20) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `up_id` int(11) DEFAULT '0',
  `up_branch` int(11) DEFAULT NULL,
  `up` int(11) DEFAULT '0',
  `down_id` int(11) DEFAULT NULL,
  `down_branch` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=439 DEFAULT CHARSET=latin1;

